import React, { useState, useEffect } from "react";
import {
  Button,
  TextField,
  List,
  ListItem,
  ListItemText,
  IconButton,
  Paper,
  Typography,
  Grid,
  MenuItem,
  Select,
  FormControl,
  InputLabel,
} from "@mui/material";
import DeleteIcon from "@mui/icons-material/Delete";
import AddItem from "./AddItem"; // Import AddItem if it's a separate component
import axios from "axios"; // Import axios for API calls

const Pantry = ({ updatePantryItems }) => {
  const [pantryInput, setPantryInput] = useState("");
  const [amount, setAmount] = useState("");
  const [measurement, setMeasurement] = useState(""); // Use a dropdown to select measurement
  const [pantryList, setPantryList] = useState([]);
  const [suggestedImages, setSuggestedImages] = useState([]); // State for suggested images

  useEffect(() => {
    // Fetch pantry items from the backend (replace with your actual API call)
    fetch("http://localhost:5000/pantry")
      .then((response) => response.json())
      .then((data) => {
        setPantryList(data || []);
        updatePantryItems(data.map((item) => item.name) || []);
      })
      .catch((error) => console.error("Error fetching pantry items:", error));

    // Fetch suggested images from Pexels when pantryInput changes
    if (pantryInput.trim()) {
      fetchSuggestedImages();
    } else {
      setSuggestedImages([]); // Clear suggestions if pantryInput is empty
    }
  }, [pantryInput, updatePantryItems]);

  const fetchSuggestedImages = async () => {
    try {
      const response = await axios.get("https://api.pexels.com/v1/search", {
        headers: {
          Authorization: "YOUR_PEXELS_API_KEY", // Replace with your Pexels API key
        },
        params: {
          query: pantryInput, // Use pantryInput as the query
          per_page: 10, // Number of images to fetch (adjust as needed)
        },
      });
      setSuggestedImages(response.data.photos);
    } catch (error) {
      console.error("Error fetching suggested images:", error);
    }
  };

  const handleAddItem = () => {
    if (pantryInput.trim() && amount.trim() && measurement.trim()) {
      const newItem = {
        name: pantryInput.trim(),
        amount: amount.trim(),
        measurement: measurement.trim(),
      };
      handleAddItem(newItem); // Assuming you have a function to handle adding items
      setPantryInput("");
      setAmount("");
      setMeasurement("");
    } else {
      console.warn("Please fill in all fields before adding.");
    }
  };

  const handleRemoveItem = (itemToRemove) => {
    fetch(`http://localhost:5000/pantry/${itemToRemove.id}`, {
      method: "DELETE",
    })
      .then(() => {
        const updatedPantryList = pantryList.filter(
          (item) => item.id !== itemToRemove.id
        );
        setPantryList(updatedPantryList);
        updatePantryItems(updatedPantryList.map((item) => item.name));
      })
      .catch((error) =>
        console.error("Error removing pantry item:", error)
      );
  };

  return (
    <Paper elevation={3} style={{ padding: "20px" }}>
      <Typography variant="h5" gutterBottom>
        Pantry Management
      </Typography>

      <AddItem addItem={handleAddItem} /> {/* Include the AddItem component */}

      {suggestedImages.length > 0 && (
        <div>
          <Typography variant="h6" style={{ marginTop: "20px" }}>
            Suggested Images
          </Typography>

          <Grid container spacing={2} style={{ marginBottom: "20px" }}>
            {suggestedImages.map((image) => (
              <Grid item xs={4} key={image.id}>
                <img
                  src={image.src.small}
                  alt={image.alt}
                  style={{
                    width: "100%",
                    height: "auto",
                    borderRadius: "8px",
                  }} // Adjust size and style as needed
                />
                <Typography variant="caption">{image.alt}</Typography>
              </Grid>
            ))}
          </Grid>
        </div>
      )}

      <Typography variant="h6" style={{ marginTop: "20px" }}>
        Current Pantry Items
      </Typography>

      <List>
        {pantryList.map((item) => (
          <ListItem
            key={item.id}
            secondaryAction={
              <IconButton
                edge="end"
                aria-label="delete"
                onClick={() => handleRemoveItem(item)}
              >
                <DeleteIcon />
              </IconButton>
            }
          >
            <ListItemText
              primary={`${item.name} (${item.amount} ${item.measurement})`}
            />
          </ListItem>
        ))}
      </List>
    </Paper>
  );
};

export default Pantry;
